function PoxFilterMonthDay(o,t,e){o>365&&(this.days-=365);const n=new Date;let r=0;for(let o=t;o<12;o+=1)r=new Date(n.getFullYear()+e,o,0).getDate()+r;return(o-r)%30>0?(o-r)%30:(o-r)%30*-1}function PoxTimeCounterFormat1(o=new Date){const t=new Date;t.setMonth(t.getMonth()+1);const e=o-t,n=Math.floor(e%1e3),r=Math.floor(e/1e3%60),a=Math.floor(e/6e4%60),h=Math.floor(e/36e5%24);let M=PoxFilterMonthDay(Math.floor(e/864e5),Math.floor(e/2592e6%12),Math.floor(e/31104e6));M<0&&(M=Math.floor(e/864e5)+1);const l=Math.floor(e/2592e6%12);return[Math.floor(e/31104e6),l,M,h,a,r,n]}function PoxTimeCounterFormat2(o=new Date){const t=new Date;t.setMonth(t.getMonth()+1);const e=o-t,n=Math.floor(e%1e3),r=Math.floor(e/1e3%60),a=Math.floor(e/6e4%60),h=Math.floor(e/36e5%24);let M=PoxFilterMonthDay(Math.floor(e/864e5),Math.floor(e/2592e6%12),Math.floor(e/31104e6));return M<0&&(M=Math.floor(e/864e5)+1),[Math.floor(e/2592e6),M,h,a,r,n]}function PoxTimeCounterFormat3(o=new Date){const t=new Date;t.setMonth(t.getMonth()+1);const e=o-t,n=Math.floor(e%1e3),r=Math.floor(e/1e3%60),a=Math.floor(e/6e4%60),h=Math.floor(e/36e5%24);return[Math.floor(e/864e5),h,a,r,n]}function PoxTimeCounterFormat4(o=new Date){const t=new Date;t.setMonth(t.getMonth()+1);const e=o-t,n=Math.floor(e%1e3),r=Math.floor(e/1e3%60),a=Math.floor(e/6e4%60);return[Math.floor(e/36e5),a,r,n]}function PoxTimeCounterFormat5(o=new Date){const t=new Date;t.setMonth(t.getMonth()+1);const e=o-t,n=Math.floor(e%1e3),r=Math.floor(e/1e3%60);return[Math.floor(e/6e4),r,n]}